import React from 'react';


class CartContainer extends React.Component{
    constructor(props) {
        super(props);
        this.state={shows:false}
    }
    
    

    render(){
        const cartStyle={
            width:'400px',
            height:'500px'
        }
        return <div style={cartStyle}>

        </div>
    }
}
export default CartContainer;
